import './App.css';
import { Routes, Route } from 'react-router-dom';
import Passkey from './component/passkey.js';
import Board from './component/Board';

function App() {
  return (
/*    <div className="App">
      <Passkey />
    </div> */
    <Routes>
      <Route path = "/" element = {<Passkey />} />
      <Route path = "/tictactoe" element = {<TicTacToe />} />
    </Routes>
  );
}

export default App;
